import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './pages/User/Home';
import Services from './pages/User/Services';
import Navbar from './components/Navbar';
import About from './pages/User/About';
import Clients from './pages/User/Clients';
import Contact from './pages/User/Contact';
import Profile from './pages/User/Profile';
import Booking from './pages/User/Booking';
import Store from './pages/User/Store';
import Notification from './pages/User/Notification';
import StylistDashboard from './pages/Stylist/StylistDashboard';
import AdminDashboard from './pages/Admin/AdminDashboard';
import AdminStylists from './pages/Admin/AdminStylists';
import Modal from './components/Modal';
import ForgotPassword from './components/ForgotPassword';

function App() {
  const [modalOpen, setModalOpen] = useState(false);

  // Check if the user is authenticated
  const isAuthenticated = () => !!localStorage.getItem('token');

  // Check if the user is a stylist
  const isStylist = () => {
    const storedUser = localStorage.getItem('user');
    if (!storedUser) return false;
    try {
      const user = JSON.parse(storedUser);
      return user.role === 'stylist';
    } catch (error) {
      console.error('Invalid user data in localStorage:', error);
      return false;
    }
  };

  // Check if the user is an admin
  const isAdmin = () => {
    const storedUser = localStorage.getItem('user');
    if (!storedUser) return false;
    try {
      const user = JSON.parse(storedUser);
      return user.role === 'admin';
    } catch (error) {
      console.error('Invalid user data in localStorage:', error);
      return false;
    }
  };

  return (
    <Router>
      <Navbar openModal={() => setModalOpen(true)} />
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<Home openModal={() => setModalOpen(true)} />} />
        <Route path="/services" element={<Services />} />
        <Route path="/user/about" element={<About />} />
        <Route path="/user/clients" element={<Clients />} />
        <Route path="/user/contact" element={<Contact />} />

        {/* Forgot Password Routes */}
        <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/reset-password/:token" element={<ForgotPassword />} />

        {/* Protected Routes for Authenticated Users */}
        <Route
          path="/profile"
          element={isAuthenticated() ? <Profile /> : <Navigate to="/" />}
        />
        <Route
          path="/booking"
          element={isAuthenticated() ? <Booking /> : <Navigate to="/" />}
        />
        <Route
          path="/store"
          element={isAuthenticated() ? <Store /> : <Navigate to="/" />}
        />
        <Route
          path="/notifications"
          element={isAuthenticated() ? <Notification /> : <Navigate to="/" />}
        />

        {/* Protected Routes for Stylists */}
        <Route
          path="/stylist-dashboard"
          element={
            isAuthenticated() && isStylist() ? <StylistDashboard /> : <Navigate to="/" />
          }
        />

        {/* Protected Routes for Admins */}
        <Route
          path="/admin-dashboard"
          element={
            isAuthenticated() && isAdmin() ? <AdminDashboard /> : <Navigate to="/" />
          }
        />
        <Route
          path="/admin/stylists"
          element={
            isAuthenticated() && isAdmin() ? <AdminStylists /> : <Navigate to="/" />
          }
        />

        {/* Fallback Route (Optional) */}
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
      <Modal isOpen={modalOpen} closeModal={() => setModalOpen(false)} />
    </Router>
  );
}

export default App;
